import React from 'react'
import { AiFillFacebook,AiFillTwitterSquare } from "react-icons/ai";


const Footer = () => {
  return (
    <div>
        <h1>FOOTER</h1>
        <span className='iconface'><AiFillFacebook/> <AiFillTwitterSquare/></span>

    </div>
  )
}

export default Footer
